We'll convert decagrams to grams, and grams to milligrams: 
$$
\begin{aligned}
2\text{ dag} &= 2\times 10\text{ g/dag} = 20\text{ g}\\
20\text{ g} &= 20\times 1000\text{ mg/g} = 20,000\text{ mg}
\end{aligned}
$$

So there are 20,000 milligrams in one 2-decagram container. 

