Out of the total 39 people who recalled dreams ranging from 1-4, Group X accounted for 28, so Group Y must have accounted for 11. Similarly, out of the total 125 people who recalled at least 5 dreams, Group X accounted for 57, so Group Y must have accounted for 68. Since we are interested in finding the probability that the person chosen at random is from Group Y given that the person recalled at least 1 dream, we should only consider the people who fall into the category of "1 to 4" dreams and "5 or more" dreams. 

Out of the total 100+100=200 people, 36 recalled no dreams. So, there are 200-36=164 people who recalled at least 1 dream. Out of these 164 people, 11 are from Group Y and 68 are from Group Y. So, the probability that a person who recalled at least 1 dream belongs to Group Y is:

\begin{align*}
\frac{\text{Number of people who recalled at least one dream and belonged to Group Y}}{\text{Number of people who recalled at least one dream}} &= \frac{11+68}{164} \\
&= \frac{79}{164}
\end{align*}

Therefore, the answer is $\boxed{\textbf{(C) }\frac{79}{164}}$
